        html += '<div id="audio_paginate_btn" class="col-12 text-center mt-4"><hr>' + '<button onclick="ThreadManager.load().threadAudio(true, \'' + data.meta.next_page_id + '\')" type="button" class="btn btn-primary">Load More <i class="fas fa-arrow-alt-circle-down"></i></button>' + '</div>';
